import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';
import { Line, Pie, Bar, Radar, Doughnut, PolarArea } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  RadarController,
  BarElement,
  Filler,
  RadialLinearScale,
  PolarAreaController,
  TimeScale,
} from 'chart.js';
import { CircleLoader } from 'react-spinners';
import './Dashboard.css';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  RadarController,
  BarElement,
  Filler,
  RadialLinearScale,
  PolarAreaController,
  TimeScale
);

function Dashboard() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [companyFilter, setCompanyFilter] = useState('All');
  const [engagementFilter, setEngagementFilter] = useState('');
  const [dateRange, setDateRange] = useState({ start: '', end: '' });
  const [darkMode, setDarkMode] = useState(false);
  const [visibleExplanations, setVisibleExplanations] = useState({});

  useEffect(() => {
    Papa.parse(
      'https://docs.google.com/spreadsheets/d/e/2PACX-1vSTTSyOvOYmKiGeKXUUzxGWjQ7z9QpoUv1rFM1kkz5g7_vgKNmbiOcZPBQnyQMQCLJcFTS_rJ03KVHD/pub?gid=0&single=true&output=csv',
      {
        download: true,
        header: true,
        dynamicTyping: true,
        complete: (result) => {
          setData(result.data);
          setLoading(false);
        },
      }
    );
  }, []);

  const filteredData = data
    .filter(entry => companyFilter === 'All' || entry['Company Name'] === companyFilter)
    .filter(entry => engagementFilter === '' || entry['Engagement (%)'] >= engagementFilter)
    .filter(entry => {
      const entryDate = new Date(entry['Date']);
      const startDate = new Date(dateRange.start);
      const endDate = new Date(dateRange.end);
      return (!dateRange.start || entryDate >= startDate) && (!dateRange.end || entryDate <= endDate);
    });

  const engagementData = filteredData.map(entry => entry['Engagement (%)']);
  const reachData = filteredData.map(entry => entry['Reach']);
  const impressionsData = filteredData.map(entry => entry['Impressions']);
  const followersData = filteredData.map(entry => entry['Followers Gained']);
  const dates = filteredData.map(entry => entry['Date']);
  const platforms = ['Instagram', 'Facebook', 'Twitter', 'LinkedIn'];
  const engagementByPlatform = platforms.map(() => Math.floor(Math.random() * 100));

  const engagementChartData = {
    labels: dates,
    datasets: [{
      label: 'Engagement Rate (%)',
      data: engagementData,
      borderColor: 'rgba(75,192,192,1)',
      fill: false,
      tension: 0.1,
    }],
  };

  const barChartData = {
    labels: dates,
    datasets: [{
      label: 'Daily Engagement',
      data: engagementData,
      backgroundColor: 'rgba(255,99,132,0.2)',
      borderColor: 'rgba(255,99,132,1)',
      borderWidth: 1,
    }],
  };

  const doughnutChartData = {
    labels: platforms,
    datasets: [{
      data: engagementByPlatform,
      backgroundColor: ['rgba(75,192,192,0.5)', 'rgba(153,102,255,0.5)', 'rgba(54,162,235,0.5)', 'rgba(255,159,64,0.5)'],
      borderColor: ['rgba(75,192,192,1)', 'rgba(153,102,255,1)', 'rgba(54,162,235,1)', 'rgba(255,159,64,1)'],
      borderWidth: 1,
    }],
  };

  const radarChartData = {
    labels: ['Reach', 'Impressions', 'Engagement', 'Followers Gained'],
    datasets: [{
      label: 'Monthly Performance',
      data: [
        reachData.reduce((a, b) => a + b, 0),
        impressionsData.reduce((a, b) => a + b, 0),
        engagementData.reduce((a, b) => a + b, 0),
        followersData.reduce((a, b) => a + b, 0),
      ],
      backgroundColor: 'rgba(75,192,192,0.2)',
      borderColor: 'rgba(75,192,192,1)',
      borderWidth: 1,
    }],
  };

  const polarAreaChartData = {
    labels: platforms,
    datasets: [{
      data: engagementByPlatform,
      backgroundColor: ['rgba(75,192,192,0.5)', 'rgba(153,102,255,0.5)', 'rgba(54,162,235,0.5)', 'rgba(255,159,64,0.5)'],
      borderColor: ['rgba(75,192,192,1)', 'rgba(153,102,255,1)', 'rgba(54,162,235,1)', 'rgba(255,159,64,1)'],
      borderWidth: 1,
    }],
  };

  const stackedBarChartData = {
    labels: dates,
    datasets: [
      { label: 'Engagement', data: engagementData, backgroundColor: 'rgba(255,99,132,0.6)' },
      { label: 'Reach', data: reachData, backgroundColor: 'rgba(75,192,192,0.6)' },
      { label: 'Impressions', data: impressionsData, backgroundColor: 'rgba(54,162,235,0.6)' },
    ],
  };

  const areaChartData = {
    labels: dates,
    datasets: [{
      label: 'Engagement Rate (%)',
      data: engagementData,
      backgroundColor: 'rgba(75,192,192,0.4)',
      borderColor: 'rgba(75,192,192,1)',
      borderWidth: 1,
      fill: true,
    }],
  };

  const explanations = {
    line: 'This line chart shows how engagement rate changes over time.',
    area: 'The area chart displays overall engagement trends with visual emphasis.',
    bar: 'This bar chart compares daily engagement values for selected filters.',
    doughnut: 'The doughnut chart shows engagement distribution by platform.',
    radar: 'Radar chart visualizes combined monthly performance metrics.',
    polar: 'Polar area chart compares engagement levels across platforms.',
    stacked: 'Stacked bar chart displays engagement, reach, and impressions together.',
  };

  const toggleExplanation = (key) => {
    setVisibleExplanations(prev => ({ ...prev, [key]: !prev[key] }));
  };

  const companyList = ['All', ...new Set(data.map(entry => entry['Company Name']))];
  const engagementLevels = [0, 20, 40, 60, 80, 100];

  if (loading) {
    return (
      <div className="loading-container">
        <CircleLoader color="#00BFFF" size={80} />
        <p>Loading data...</p>
      </div>
    );
  }

  return (
    <div className={`dashboard-container ${darkMode ? 'dark' : 'light'}`}>
      <div className="sidebar">
        <h3>Dashboard</h3>
        <button onClick={() => setDarkMode(!darkMode)} className="toggle-mode">
          {darkMode ? '‚òÄÔ∏è Light Mode' : 'üåô Dark Mode'}
        </button>

        <select onChange={(e) => setCompanyFilter(e.target.value)} value={companyFilter}>
          {companyList.map((company, index) => (
            <option key={index} value={company}>{company}</option>
          ))}
        </select>

        <select onChange={(e) => setEngagementFilter(e.target.value)} value={engagementFilter}>
          <option value="">Select Engagement Filter</option>
          {engagementLevels.map((level) => (
            <option key={level} value={level}>{`> ${level}%`}</option>
          ))}
        </select>

        <div className="date-range-picker">
          <input type="date" value={dateRange.start} onChange={(e) => setDateRange({ ...dateRange, start: e.target.value })} />
          <input type="date" value={dateRange.end} onChange={(e) => setDateRange({ ...dateRange, end: e.target.value })} />
        </div>
      </div>

      <div className="main-content">
        <h2>Social Media Performance Dashboard</h2>
        <div className="chart-container">
          {[
            { key: 'line', label: 'Engagement Rate Over Time', chart: <Line data={engagementChartData} /> },
            { key: 'area', label: 'Area Chart - Engagement', chart: <Line data={areaChartData} /> },
            { key: 'bar', label: 'Daily Engagement Comparison', chart: <Bar data={barChartData} /> },
            { key: 'doughnut', label: 'Engagement by Platform', chart: <Doughnut data={doughnutChartData} /> },
            { key: 'radar', label: 'Monthly Performance', chart: <Radar data={radarChartData} /> },
            { key: 'polar', label: 'Engagement by Platform (Polar Area)', chart: <PolarArea data={polarAreaChartData} /> },
            {
              key: 'stacked',
              label: 'Stacked Bar Chart',
              chart: <Bar data={stackedBarChartData} options={{ scales: { x: { stacked: true }, y: { stacked: true } } }} />
            }
          ].map(({ key, label, chart }) => (
            <div className="chart-card" key={key}>
              <h3>{label}</h3>
              {chart}
              <button onClick={() => toggleExplanation(key)} className="explanation-toggle">
                {visibleExplanations[key] ? 'Hide Explanation' : 'Show Explanation'}
              </button>
              {visibleExplanations[key] && <p className="chart-explanation">{explanations[key]}</p>}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
